=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { Component } from "react";
import { Grid, Row, Col, Table } from "react-bootstrap";

import Card from "components/Card/Card.jsx";
import { thArray, tdArray } from "variables/Variables.jsx";

class ToDoList extends Component {
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="Schedule"
                category="Release and Claims Calendar"
                ctTableFullWidth
                ctTableResponsive
                content={
                  <iframe src="https://calendar.google.com/calendar/embed?src=brian.roytman%40gmail.com&ctz=America%2FChicago" style={{border:0}} width="800" height="600" frameborder="0" scrolling="no"></iframe>
                }
              />
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default ToDoList;
